The Secretary of State may commence a proceeding to administratively dissolve an entity:
If the entity does not deliver for filing its annual report with the Secretary of State by the due date thereof;
If the entity is without a registered office or registered agent in this state for sixty (60) days or more;
If the entity does not notify the Secretary of State within sixty (60) days that its registered office or registered agent has been changed, that its registered office has been discontinued or that its registered agent has resigned; or
For such other reasons as are provided in this chapter or the organic law governing the entity.
